--
-- Database: `cursus`
--
CREATE DATABASE IF NOT EXISTS `cursus` DEFAULT CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci;
USE `cursus`;

-- --------------------------------------------------------

--
-- Tabelstructuur voor tabel `artikelen`
--

CREATE TABLE `artikelen` (
  `artnr` int(11) NOT NULL DEFAULT 0,
  `omschr` varchar(25) NOT NULL DEFAULT '',
  `prijs` decimal(10,2) NOT NULL DEFAULT 0.00,
  `voorraad` int(11) NOT NULL DEFAULT 0,
  `verpeenh` int(11) NOT NULL DEFAULT 0,
  `artgroepnr` int(11) NOT NULL DEFAULT 0,
  `locatie` int(11) NOT NULL DEFAULT 0,
  `runner` int(11) NOT NULL DEFAULT 0
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

--
-- Gegevens worden geëxporteerd voor tabel `artikelen`
--


-- --------------------------------------------------------

--
-- Tabelstructuur voor tabel `klanten`
--

CREATE TABLE `klanten` (
  `klantnr` int(11) NOT NULL DEFAULT 0,
  `klnaam` varchar(30) NOT NULL DEFAULT '',
  `klstraat` varchar(25) NOT NULL DEFAULT '',
  `klhuisnr` varchar(8) NOT NULL DEFAULT '',
  `klpostcode` varchar(10) NOT NULL DEFAULT '',
  `klplaats` varchar(20) NOT NULL DEFAULT '',
  `klnetn` varchar(5) NOT NULL DEFAULT '0',
  `kltel` varchar(11) NOT NULL DEFAULT '0',
  `klfax` varchar(11) NOT NULL DEFAULT '0',
  `klemail` varchar(50) CHARACTER SET latin1 COLLATE latin1_bin NOT NULL DEFAULT '',
  `klpostbus` int(11) NOT NULL DEFAULT 0,
  `klpbpcode` varchar(10) NOT NULL DEFAULT '',
  `klpbplaats` varchar(20) NOT NULL DEFAULT '',
  `klantcode` int(11) NOT NULL DEFAULT 0,
  `klcontact` varchar(50) NOT NULL DEFAULT '',
  `klopmerking` varchar(50) NOT NULL DEFAULT '',
  `kredietlimiet` decimal(10,2) NOT NULL DEFAULT 0.00
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

--
-- Gegevens worden geëxporteerd voor tabel `klanten`
--


-- --------------------------------------------------------

--
-- Tabelstructuur voor tabel `orderregel`
--

CREATE TABLE `orderregel` (
  `ordernr` int(4) NOT NULL DEFAULT 0,
  `artnr` int(4) NOT NULL DEFAULT 0,
  `aantal` int(4) NOT NULL DEFAULT 0
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

--
-- Gegevens worden geëxporteerd voor tabel `orderregel`
--


-- --------------------------------------------------------

--
-- Tabelstructuur voor tabel `orders`
--

CREATE TABLE `orders` (
  `ordernr` int(4) NOT NULL DEFAULT 0,
  `klantnr` int(4) NOT NULL DEFAULT 0,
  `persnr` int(4) NOT NULL DEFAULT 0,
  `orderdatum` date NOT NULL DEFAULT '0000-00-00',
  `orderbedrag` decimal(10,2) NOT NULL DEFAULT 0.00,
  `leverdatum` date NOT NULL DEFAULT '0000-00-00',
  `verzendcode` int(11) NOT NULL DEFAULT 0,
  `betalingscondities` varchar(12) NOT NULL DEFAULT '',
  `orderopmerking` varchar(50) NOT NULL DEFAULT ''
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

--
-- Gegevens worden geëxporteerd voor tabel `orders`
--


-- --------------------------------------------------------

--
-- Tabelstructuur voor tabel `personeel`
--

CREATE TABLE `personeel` (
  `persnr` int(11) DEFAULT NULL,
  `anaam` varchar(20) DEFAULT NULL,
  `vnaam` varchar(15) DEFAULT NULL,
  `tnaam` varchar(10) DEFAULT NULL,
  `titel` varchar(10) DEFAULT NULL,
  `tstnr` int(11) DEFAULT NULL,
  `straat` varchar(25) DEFAULT NULL,
  `huisnr` varchar(5) DEFAULT NULL,
  `plaats` varchar(25) DEFAULT NULL,
  `postcode` varchar(7) DEFAULT NULL,
  `telpriv` varchar(11) DEFAULT NULL,
  `email` varchar(25) DEFAULT NULL,
  `afdeling` varchar(15) DEFAULT NULL,
  `fte` varchar(20) DEFAULT NULL,
  `startdatum` date DEFAULT NULL,
  `salaris` decimal(10,2) DEFAULT NULL,
  `toeslag` decimal(10,2) DEFAULT NULL,
  `gebdatum` date DEFAULT NULL
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

--
-- Gegevens worden geëxporteerd voor tabel `personeel`
--


--
-- Indexen voor geëxporteerde tabellen
--

--
-- Indexen voor tabel `orders`
--
ALTER TABLE `orders`
  ADD PRIMARY KEY (`ordernr`);